  render() {
    return (
      <div className="loader">
        <div className="row">
          <div className="col-sm text-center">
            <img src={logo} alt="logo" />

            <div className="typing">
              <p>Loading ...</p>
            </div>
            {/* <p className="align-center">      Loading . . . </p> */}
          </div>
        </div>
      </div>
    );
  }
}

